import React from 'react';
import './Home.css';
import { TweenMax, Expo } from 'gsap';

// Return logo avatar image
export default function RetuRnlOgo() {

 React.useEffect(() => {

  TweenMax.from('.wrp-logo img', 10, { delay: 1.5, scale: 60.60, ease: Expo.easeInOut, opacity: 0 });

 }, []);

 return (
  <div className='wrp-logo'>

   <img src={'/img/logo.png'} alt='logo view alliance pour le changement' />
  </div>
 );
}
